import React from 'react';
//import logo from './logo.svg';
import './App.css';


class FormLogin extends React.Component{
  render(){
    return(
      <div>
        <div className="App-titulo">{this.props.TituloPrincipal}</div>
        <div><input type="text" name="nombredelacaja" placeholder={this.props.PlaceHolderUsuario}/></div>
        <div><input type="password" name="txtPassword" placeholder="**********"/></div>
        <div><button type="button">Click Me!</button></div>        
      </div>

    )
  }
}

class App extends React.Component{
  render(){
    return(
      <div className="App">
      <header className="App-header">

      <FormLogin TituloPrincipal="KeyManage Juan" PlaceHolderUsuario="Usuario"></FormLogin>

      </header>
    </div>
    )
  }
}







export default App;
